export default class Liga extends React.Component {

    constructor(props) {
        super(props);
            }

            render() {
                return(
                    <div className="row">
                        <div className="col-12 d-flex align-items-center py-3">
                            <img src={this.props.img} alt={this.props.nombre} className="liga-thumb"/>
                            <div className="px-3">
                            <h2> {this.props.nombreLiga} </h2>
                            <p> {this.props.descripcionLiga} </p>
                            </div>
                            </div>
                            </div>
                            )
}
}
